CREATE DATABASE IF NOT EXISTS COMP1011Java;
USE COMP1011Java;
DROP TABLE IF EXISTS ufoSightings;
CREATE TABLE IF NOT EXISTS ufoSightings
(
	sightingID INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    city VARCHAR(100),
    state VARCHAR(45),
    country VARCHAR(30),
    durationSec INT(10),
    ufoShape VARCHAR(30)    
);

Select * from ufoSightings;


SELECT COUNT(*) FROM ufoSightings;

